CREATE TABLE `pagos` (
  `factura_id` int NOT NULL,
  `monto` decimal(10,2) NOT NULL,
  `fecha_pago` datetime NOT NULL,
  `estado` enum('pendiente','procesando','completado','fallido','cancelado') NOT NULL,
  `metodo_pago` varchar(50) NOT NULL COMMENT 'Efectivo, Transferencia, Tarjeta, PSE, etc.',
  `referencia` varchar(100) DEFAULT NULL COMMENT 'Número de referencia del pago',
  `observaciones` text COMMENT 'Observaciones sobre el pago',
  `doc_type` varchar(10) DEFAULT NULL COMMENT 'Tipo de documento (CC, CE, etc.)',
  `document` varchar(20) DEFAULT NULL COMMENT 'Número de documento',
  `name` varchar(100) DEFAULT NULL COMMENT 'Nombre del pagador',
  `last_name` varchar(100) DEFAULT NULL COMMENT 'Apellido del pagador',
  `email` varchar(100) DEFAULT NULL COMMENT 'Email del pagador',
  `ind_country` varchar(5) DEFAULT NULL COMMENT 'Código país (57=Colombia)',
  `phone` varchar(20) DEFAULT NULL COMMENT 'Teléfono del pagador',
  `country` varchar(5) DEFAULT NULL COMMENT 'Código país',
  `city` varchar(100) DEFAULT NULL COMMENT 'Ciudad del pagador',
  `address` varchar(200) DEFAULT NULL COMMENT 'Dirección del pagador',
  `ip` varchar(45) DEFAULT NULL COMMENT 'IP del cliente',
  `currency` varchar(5) DEFAULT NULL COMMENT 'Moneda',
  `description` varchar(500) DEFAULT NULL COMMENT 'Descripción del pago',
  `value` decimal(10,2) DEFAULT NULL COMMENT 'Valor del pago',
  `tax` decimal(10,2) DEFAULT NULL COMMENT 'Impuestos',
  `ico` decimal(10,2) DEFAULT NULL COMMENT 'ICO',
  `tax_base` decimal(10,2) DEFAULT NULL COMMENT 'Base imponible',
  `url_response` varchar(500) DEFAULT NULL COMMENT 'URL de respuesta',
  `url_confirmation` varchar(500) DEFAULT NULL COMMENT 'URL de confirmación',
  `method_confirmation` varchar(10) DEFAULT NULL COMMENT 'Método confirmación',
  `ref_payco` varchar(50) DEFAULT NULL COMMENT 'Referencia de ePayco',
  `transaction_id` varchar(100) DEFAULT NULL COMMENT 'ID de transacción',
  `bank_name` varchar(100) DEFAULT NULL COMMENT 'Nombre del banco',
  `bank_url` varchar(500) DEFAULT NULL COMMENT 'URL del banco',
  `response_code` varchar(10) DEFAULT NULL COMMENT 'Código de respuesta',
  `response_message` varchar(500) DEFAULT NULL COMMENT 'Mensaje de respuesta',
  `id` int NOT NULL AUTO_INCREMENT,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `factura_id` (`factura_id`),
  KEY `ix_pagos_id` (`id`),
  CONSTRAINT `pagos_ibfk_1` FOREIGN KEY (`factura_id`) REFERENCES `facturacion` (`id`)
